import Toolbar from "./Toolbar/Toolbar";
import styles from "./ToolbarContainer.module.css";

class ToolbarContainer extends Components{
  constructor(props){
    super(props)
    this.state = {
      isSignup: true
    }
  }
  render(){
    return (
      <div className = {styles.Tool}>
        <Toolbar/>
        <main></main>
      </div>
    )
  }
}
